import styled from "styled-components";


export const HeaderComponent = styled.header`
    display: flex;
    background-color: #35383d;
    width: 100%;
    justify-content: space-between;
    align-items: center;
    color: #111;
    gap: 2rem;
    padding: 10px 0px;
    overflow: hidden;

    h1{
        color: #fff;
        margin: 0;
        padding: 0;
    }

    img{
        width: 100px;
        height: auto;
    }

`;


export const HeaderContent = styled.div`

`;
